function extractFileNameAndExtension(filePath) {
    // Extract filename and extension using regular expression
    const regex = /^.*[\\/]/;
    const fullPathWithoutPath = filePath.replace(regex, '');

    const lastDotIndex = fullPathWithoutPath.lastIndexOf('.');
    const fileName = fullPathWithoutPath.substring(0, lastDotIndex);
    const extension = fullPathWithoutPath.substring(lastDotIndex + 1);

    return {
        fileName: fileName,
        extension: extension
    };
}

